import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from "react-router-dom";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./App.css";
import Profile from "./Profile";

export default function App() {
  const [isNavOpen, setNavOpen] = useState(false);
  const navigate = useNavigate();

  const toggleNav = () => {
    setNavOpen(!isNavOpen);
  };

  const carouselSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  const carouselImages = ["table.png", "chaise.jpeg", "armoire.jpeg"];
  const gridImages = ["table.png", "chaise.jpeg", "armoire.jpeg", "chaisegamer.jpeg", "lampe.webp", "armoireantique.jpeg"];

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <div className="profile-container" onClick={toggleNav}>
            <img src={process.env.PUBLIC_URL + "/user.jpeg"} alt="user" className="profile-picture" />
          </div>
          <div className="search-container">
            <input type="text" placeholder="Rechercher des meubles d'occasion..." className="search-bar" id="searchBar" />
            <button className="search-button">Rechercher</button>
            <img src={process.env.PUBLIC_URL + "/LogoAmpunv.jpeg"} alt="Logo du site" className="site-logo" />
          </div>
        </header>

        {isNavOpen && (
          <div className="nav-bar">
            <Link to="/" className="nav-link" onClick={() => { toggleNav(); navigate('/'); }}>
              Accueil
            </Link>
            <Link to="/meubles" className="nav-link" onClick={() => { toggleNav(); navigate('/meubles'); }}>
              Meubles
            </Link>
            <Link to="/panier" className="nav-link" onClick={() => { toggleNav(); navigate('/panier'); }}>
              Panier
            </Link>
            <Link to="/profile" className="nav-link" onClick={() => { toggleNav(); navigate('/profile'); }}>
              Profil
            </Link>
          </div>
        )}

        <div className="spacer"></div>
        {window.location.pathname !== '/profile' && <h2 style={{ textAlign: "left", marginLeft: "100px" }}>Les Bons plans :</h2>}

        <Routes>
          <Route path="/profile" element={<Profile />} />
          <Route
            path="/"
            element={
              <>
                <Slider {...carouselSettings} className="carousel-container">
                  {carouselImages.map((image, index) => (
                    <div key={index} className="carousel-item">
                      <img src={process.env.PUBLIC_URL + `/meuble/${image}`} alt={`Meuble ${index + 1}`} />
                      <p>Nom du Meuble {index + 1}</p>
                    </div>
                  ))}
                </Slider>
                <br></br>
                <br></br>
                <br></br>
                <h3>Les Nouveautés:</h3>
                <div className="grid-container">
                  {gridImages.map((image, index) => (
                    <div key={index} className="grid-item">
                      <img src={process.env.PUBLIC_URL + `/meuble/${image}`} alt={`Meuble ${index + 1}`} />
                      <p>Nom du Meuble {index + 1}</p>
                      <p>Prix: [Ajouter le prix ici]</p>
                    </div>
                  ))}
                </div>
              </>
            }
          />
        </Routes>
      </div>
    </Router>
  );
}
